import {
  AppBar,
  Typography,
  Toolbar,
  Box,
  Button,
  Tab,
  Tabs,
} from "@mui/material";

const Header = () => {
  const [value, setValue] = useState(0);

  return (
    <AppBar
      position="sticky"
      sx={{
        background:
          "linear-gradient(90deg, rgba(2,0,36,1) 0%, rgba(9,9,121,1) 35%, rgba(0,212,255,1) 100%)",
      }}
    >
      <Toolbar>
        <Typography variant="h4"> BlogsApp </Typography>{" "}
        <Box display="flex" marginLeft={"auto"} marginRight={"auto"}>
          <Tabs
            textColor="inherit"
            value={value}
            onChange={(e, val) => setValue(val)}
          >
            <Tab LinkComponent={Link} label="All Blogs" />
            <Tab label="My Blogs" />
          </Tabs>{" "}
        </Box>{" "}
        <Box display="flex" marginLeft="auto">
          <Button
            variant="contained"
            sx={{ margin: 1, borderRadius: 10 }}
            color="warning"
          >
            Login{" "}
          </Button>{" "}
          <Button
            variant="contained"
            sx={{ margin: 1, borderRadius: 10 }}
            color="warning"
          >
            Signup{" "}
          </Button>{" "}
          <Button
            variant="contained"
            sx={{ margin: 1, borderRadius: 10 }}
            color="warning"
          >
            Logout{" "}
          </Button>{" "}
        </Box>{" "}
      </Toolbar>{" "}
    </AppBar>
  );
};

export default Header;
